function ShoppingCartViewModel(){var n=this;n.listProduct=ko.observableArray([]);n.totalPrice=ko.observable(0);n.totalMoney=ko.observable("");n.addProductQuantity=function(t,i){i?t.productQuantity(t.productQuantity()+1):t.productQuantity()>0&&t.productQuantity(t.productQuantity()-1);n.renderTotalPrice()};n.renderTotalPrice=function(){n.totalPrice(_.reduce(n.listProduct(),function(n,t){return n+t.totalPrice()},0));n.totalMoney(ConverMoneyToString(formatNumberic(n.totalPrice(),"N0")))};$(document).ready(function(){products&&(_.each(products,function(n){n.productQuantity=ko.observable(n.quantity);n.totalPrice=ko.computed(function(){return n.product.salePrice*n.productQuantity()});n.id=n.product.id;n.name=n.product.name;n.salePrice=n.product.salePrice;n.thumbnail=n.product.thumbnail;n.defaultUnit=n.product.defaultUnit;n.seoLink=n.product.seoLink}),n.listProduct(products),n.renderTotalPrice())})}var viewModel=new ShoppingCartViewModel;ko.applyBindings(viewModel,document.getElementsByClassName("shopping-carts")[0]);